DESCRIPTION:
Siunčiu pranešimą apie blogai tvarkomą infrastruktūrą mieste - kuomet sugedę elementai, vietoje to, kad būtų sutaisyti originaliomis dalimis arba pakeisti, yra tiesiog pašalinami. Kaikurie iš jų buvo mano užregistruoti.
1. vaikų žaidimų aikštelės elementai - nutrūkusios ar benutrūkstančios virvės buvo nuimtos, naujos nesumonuotos, E50-5385/22(3.2.55E-AD24);
2. sulankstytas dviračių prirakinimo stovas buvo demontuotas, naujas nepastatytas, E50-10225/22(3.2.55E-AD24);
3. medis nupjautas ir neatsodintas.
Tokia miesto infrastruktūros priežiūra yra YDINGA, su laiku pati infrastruktūra yra ne prižiūrima ir gerinama, o nykstanti.

